import React from 'react';
import './HomePage.css';

const HomePage = () => {
    return (
        <div className="home-content">
            <div className="hero-section">
                <div className="hero-text">
                    <h1>Seamless Food</h1>
                    <h1>Ordering, Fast,</h1>
                    <h1>Simple, Stress-Free!</h1>
                    <h2>Effortless Pre-Orders, Instant Enjoyment, Anytime!</h2>
                </div>
            </div>
        </div>
    )
}

export default HomePage;
